    <div>
      <div className='border border-[#e4e4e4] h-[300px] relative overflow-hidden group transition'>
        <div className='w-full h-full flex jus items-center'>
          <div className='w-[200px] mx-auto flex justify-center'>
            <img className='max-h-[160px] gro' src={image} alt="" />
          </div>
        </div>
      </div>
      <div>2</div>
    </div>
  )

};

